import React from 'react'

function Button({children,onClick}) {
    console.log("buttoncomponent");
  return (
    <div>
        <button onClick={onClick} className='bg-indigo-900 rounded p-2 text-white'>
            {children}
        </button>
    </div>
  )
}

export default React.memo(Button)
